import React from 'react';
import './App.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import SearchPage from "./components/search_page/search_page";
import HomePage from "./components/home_page/home_page";
import SingleApartment from "./components/single_apartment_page";


class App extends React.Component{
    render() {
        return(
            <div>
                <Router>
                    <Switch>
                        <Route path="/">
                            <HomePage/>
                        </Route>
                        <Route path="/SearchPage">
                            <SearchPage/>
                        </Route>
                        <Route path={"/singleApartment/:id"} component={SingleApartment}/>

                    </Switch>
                </Router>
            </div>
        )
    }
}

export default App;
